package oop.ch07.v05.interfaceInheritance;

public class MyClass implements MyInterface {

	// X interface와 Y interface를 상속받은 MyInterface 를 구현(implements)한 MyClass
	
	// 상위 인터페이스들에서 구현되지 않은 모든 추상 메서드를 여기서 구현한다.
	
	// MyClass는 MyInterface 타입이기도 하지만, X 타입이기도 하고, Y 타입이기도 한다. -> 타입 상속 (type inheritance)
	
	@Override
	public void x() {
		// TODO Auto-generated method stub
		
	}

	@Override
	public void y() {
		// TODO Auto-generated method stub
		
	}

	@Override
	public void myMethod() {
		// TODO Auto-generated method stub
		
	}

	
	
	
}
